// Frontend code 
// Filename - App.js
// Filename - App.js

import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import {
	Link,
	Routes,
  } from "react-router-dom";
  import Login from './Login';
  import Regi from './Regi';


function App() {

	return (
		<div>
		<Regi />
		<Routes>
			<Route path="/" element={<Regi />} />
			<Route path="/login" element={<Login />} />
		</Routes>
		</div>
	);
}

export default App;
